import React, { Component } from "react";
import Round from './Round';

export class User extends Component {
  render() {
    const { username } = this.props;
    return (
      <div className="viewable">
        <h2>Good Luck {username}!</h2>
        <br /><br />
        <p className="loot">&#128176;</p>
        <div>
          <Round />
        </div>
      </div>      
    );
  }
}

export default User;
